const Header = () => (
  <div>
    <Navbar bg="dark" variant="dark">
      <Navbar.Brand href="#home">Lotteries</Navbar.Brand>
      <Nav className="me-auto">

      </Nav>
      <Nav>
        <NavItem href="#">
          <div className="col-md-12 text-center">
            <Link to='/login'>
              <Button
                class="btn btn-success"
                onClick={() =>   localStorage.removeItem('savedToken') && props.history.push('/login')}
              >LogOut</Button>
            </Link>
          </div>
          {/* <Link to="/Register">
   <a style={{padding:'20px'}}>Register</a></Link> */}
        </NavItem>

        <NavItem href="#">
          <Link to="/listTicket">Go Home Page</Link>
        </NavItem>
      </Nav>

    </Navbar>
  </div>
);

export default Header;
